import "./DarkBlock.scss";
export const DarkBlock = () => {
  return (
    <div className="darkBlock">
      <div className="headerImage"></div>
      <div className="headerContact">
        <li>
          <span>E:</span>
          <a href="mailto:info@minerva-advocaten.nl">
            info@minerva-advocaten.nl
          </a>
        </li>
        <li>
          <span>T:</span>
          <a href="tel:+31103076677">+31 10 3076677</a>
        </li>
      </div>
      {`Advocatenkantoor Minerva werd in 2019 opgericht door drie advocaten met ruime ervaring in de advocatuur, die in de loop der jaren verbonden zijn geweest aan diverse Rotterdamse advocatenkantoren, en nu samen een mooi en modern kantoor runnen.`}
    </div>
  );
};
